import json

from langchain_openai import OpenAIEmbeddings

from langchain_caai.caai_emb_client import caai_emb_client

with open('../config.json') as user_file:
    config = json.load(user_file)

llm_api_key = config['llm_api_key']
llm_api_base = config['llm_api_base']
llm_api_base_local = config['llm_api_base_local']

embeddings = caai_emb_client(
    api_key=llm_api_key,
    api_url=llm_api_base,
    max_batch_size=10
)

def process_query(query):

    #single query
    query_result = embeddings.embed_query(query)
    #document query
    document_result = embeddings.embed_documents([query, query])

    return query_result, document_result

